import React from "react";
import { ReactFlow,ReactFlowProvider } from "@xyflow/react";

export const Editor=()=> {
    const {Controls,MiniMap,Background,nodes,edges,onNodesChange,onEdgesChange,onConnect,react}=ReactFlow;
  return (
    <div style={{height:'100vh',width:'100%'}}>
        <div style={{position:'absolute',zIndex:10,top:10,left:10}}>
            <button style={{marginRight:5}}>Rectangle</button>
            <button style={{marginRight:5}}>Circle</button>
            <button style={{marginRight:5}}>Download</button>
        </div>
        <div ref={ReactFlowProvider} style={{height:'100%',width:'100%'}}>
            <ReactFlow nodes={nodes} edges={edges} onNodesChange={onNodesChange} onEdgesChange={onEdgesChange} onConnect={onConnect} fitView><MiniMap/>
            <Controls/><Background color="#aaa" gap={16}/></ReactFlow>
        </div>
    </div>
  );
};
